}

class Index extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      jsonObjec: false,
      response: false,
    };
  }
  handleSubmit = (t) => {
    this.setState({ jsonObjec: t });
    this.setState({ response: sendRequest(t) })
  };

  test = (h) => {
      this.setState({ response: h})
  }
  render() {
    return (
      <Layout>
        <div>
          <Form handleSubmit={this.handleSubmit} />
        </div>
      </Layout>
    );
  }
}

async function sendRequest(json) {
  const res = await fetch(api_url, {
    method: "POST",
    headers: {
      "Content-Type": "application/json",
    },
    body: JSON.stringify(json),
  });
  const data = await res.json();
  console.log(data)
  return data
}

export default Index;
